import logo from './logo.svg';
import './App.css';
import { Table, Tag, Space } from 'antd';
import 'antd/dist/antd.css';
import { useSelector } from "react-redux";
import { useDispatch } from "react-redux";
import React from 'react';
import { getData } from './redux/actions'
import { connect } from "react-redux";

function App({ fetchcoins,data1 }) {


  React.useEffect(()=>{
  fetchcoins() 
  },[])
  const columns = [
    {
      title: 'Name',
      dataIndex: 'name',
      key: 'name',
      render: text => <div><a>{text}</a><img src={'https://assets.coincap.io/assets/icons/'+text.symbol} /></div>,
    },
    {
      title: 'ID',
      dataIndex: 'id',
      key: 'id',
    },
    {
      title: 'Change Percent in 24Hr',
      dataIndex: 'changePercent24Hr',
      key: 'changePercent24Hr',
    },
    {
      title: 'Explorer',
      dataIndex: 'explorer',
      key: 'explorer',
    },
    {
      title: 'Address',
      dataIndex: 'address',
      key: 'address',
    },
    {
      title: 'marketCapUsd',
      dataIndex: 'marketCapUsd',
      key: 'marketCapUsd',
    },
    {
      title: 'maxSupply',
      dataIndex: 'maxSupply',
      key: 'maxSupply',
    },
    {
      title: 'priceUsd',
      dataIndex: 'priceUsd',
      key: 'priceUsd',
    },

    {
      title: 'Rank',
      dataIndex: 'rank',
      key: 'rank',
    },
    {
      title: 'Supply',
      dataIndex: 'supply',
      key: 'supply',
    },
    {
      title: 'Symbol',
      dataIndex: 'symbol',
      key: 'symbol',
    },
    {
      title: 'volumeUsd24Hr',
      dataIndex: 'volumeUsd24Hr',
      key: 'volumeUsd24Hr',
    },
    {
      title: 'vwap24Hr',
      dataIndex: 'vwap24Hr',
      key: 'vwap24Hr',
    },

  ];

  const data = [
    {
      key: '1',
      name: 'John Brown',
      age: 32,
      address: 'New York No. 1 Lake Park',
      tags: ['nice', 'developer'],
    },
    {
      key: '2',
      name: 'Jim Green',
      age: 42,
      address: 'London No. 1 Lake Park',
      tags: ['loser'],
    },
    {
      key: '3',
      name: 'Joe Black',
      age: 32,
      address: 'Sidney No. 1 Lake Park',
      tags: ['cool', 'teacher'],
    },
  ];
  return (
    <div className="App">
      {console.log("data",data1,data)}
      {data1?.loading ?
        <h2>loading</h2>  
:<Table columns={columns} dataSource={data1.data} />

}
    </div>
  );
}

function mapStateToProps(state) {
  return {
    data1: state
  };
}
const mapDispatchToProps = dispatch => {
  return {
   fetchcoins: () => dispatch(getData()) 
  }
} 
export default connect(mapStateToProps,mapDispatchToProps)(App);
